How many rectangles are in this figure?\\
\\

\begin{asy}
import olympiad;
import cse5;
defaultpen(white);
size(100);

pair A,B,C,D,E,F,G,H,I,J,K,L;
A=(0,0);
B=(20,0);
C=(20,20);
D=(0,20);
draw(A--B--C--D--cycle);
E=(-10,-5);
F=(13,-5);
G=(13,5);
H=(-10,5);
draw(E--F--G--H--cycle);
I=(10,-20);
J=(18,-20);
K=(18,13);
L=(10,13);
draw(I--J--K--L--cycle);
\end{asy}
